import { BrowserRouter, Routes, Route, Outlet} from 'react-router-dom';

function HomePage(){
  return(
    <h1>Home</h1>
  )
}

function AboutUsPage(){
  return(
    <h1>About us</h1>
  )
}

function TaskBaordPage(){
  return(
    <h1>Task Board</h1>
  )
}

function ManageTaskPage(){
  return(
    <h1>Manage Task</h1>
  )
}

function CreateTaskPage(){
  return(
    <h1>Create Task</h1>
  )
}

function LoginPage(){
  return(
    <h1>Create Task</h1>
  )
}

function SignupPage(){
  return(
    <h1>Create Task</h1>
  )
}

function NoPage(){
  return(
    <h1>No Page found</h1>
  )
}

function AppLayout() {
  return (
    <>
    <nav>
            <a>Home</a> | 
            <a>About us</a> | 
            <a>Task Board</a>
            <a>Manage Task</a>
            <a>Login</a> | 
            <a>Signup</a> |  
            <a>Contact Us</a> | 
          </nav>
          <Outlet/>
    </>
  )
}

function App() {
  return (
        <>

        </>
  );
}

export default App;
